import React from 'react';
import Typical from 'react-typical'
import Background from '../Components/img/chicago.jpg';

const LandingPage=(props)=>{
    return(
    <>
    <div className='photo'>
        <img className='city' src={Background} alt="Photo by: Gautum Krishnan " />
        <h2 className="greeting">Hi, I'm Summer Bakr.</h2>
        <h3 className="subgreeting">I'm a </h3>
        <div className="typing">
        <Typical
            steps={['budding software developer', 1000, 'avid learner', 1000, "dedicated and passionate individual", 1000]}
            loop={Infinity}
            wrapper="p"
        /></div>
    </div>

    <div className='header'>
        <h2 className="greeting">Hi, I'm Summer Bakr.</h2>
        <h3 className="subgreeting">I'm a </h3>
        <div className="typing">
        <Typical
            steps={['budding software developer', 1000, 'avid learner', 1000, "dedicated and passionate individual", 1000]}
            loop={Infinity}
            wrapper="p"
        /></div>
        <h3>Chicago-based Software Engineer with a background in Full Stack Development. I have an affinity for learning new technologies, and particulary enjoy working with server-side technologies. My experiences allow me to bring a unique and fresh perspective to any team. </h3>
    </div>
    </>
    );
}
export default LandingPage;
